import Home from "./pages/Home";
import ManageRoutines from "./pages/ManageRoutines"

const routes = [
    {
        path: "/",
        element: <Home />
    },
    {
        path: "/manage-routines",
        element: <ManageRoutines />
    }
];

export default routes;
